import React, { useEffect } from "react";
import styled from "styled-components";
import Aos from "aos";
import "aos/dist/aos.css";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
`;

const Grids = styled.div`
  max-width: 50%;
  margin: auto;
`;

const Boxes = styled.div`
  margin: 20px;
  width: 100%;
  background: rgb(198, 177, 198);
  overflow: hidden;
  height: 200px;
  max-height: 35vh;
  box-shadow: 0px 12px 18px -6px rgba(0, 0, 0, 0.3);
  & + & {
    margin-top: 150px;
  }
`;

const AboutContents = () => {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);
  return (
    <>
      <h1>Pricing</h1>
      <Grids>
        <Boxes>1</Boxes>
        <Boxes>2</Boxes>
        <Boxes>3</Boxes>
        <Boxes data-aos="fade-up">4</Boxes>
        <Boxes data-aos="fade-right">5</Boxes>
        <Boxes>6</Boxes>
        <Boxes>6</Boxes>
        <Boxes>6</Boxes>
        <Boxes>6</Boxes>
        <Boxes>6</Boxes>
        <Boxes>6</Boxes>
      </Grids>
    </>
  );
};

export default AboutContents;
